  constructor(props) {
    super(props);

    this.state={
      newItem:"",
      list:[]
    }
  }
render() {
  return (
    <div className="App">
      <div>
        Add an item..
        <br/>
        <input
          type="text"
          placeholder="Type item here..."
          value={this.state.newItem}
          onChange= {e => this.updateInput("newItem", e.target.value)}
          />
          <button
          onClick={() => this.addItem()}
          >
            Add
          </button>
      </div>
    </div>
  );
}
}

export default App;
